import { Grid,Row,Col} from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import '../App.css';
class FooterBar extends Component {
  render() {
    return (
        <div className='footer-layout'>
            <div className='footer-container'>
            Syarat Penggunaan
            Kebijakan Privasi
            Tentang Kami
            FAQ
            Hubungi Kami
            </div>

        </div>
    );
  }
}

export default FooterBar;
